import classes from './Cart.module.css';
import React, {useContext} from 'react';
import Modal from '../UI/Modal';
import Card from '../UI/Card';
import { ButtonContext } from '../context/ButtonContext';
const Cart = () =>{
	const {setState} = useContext(ButtonContext);
	const closeHandler = () =>{
		setState(false);
	}
	 const cartItems=<ul className={classes['cart-item']}>{ [{id:'34', name:'bhonta', numbers:'3',price:'$24.55'}].map(m=><li>{m.name}</li>
	

	)}</ul>
	return(
		<Card>
		<Modal onClose={closeHandler} >
	
		{cartItems}
			<div className={classes.total}>
				<span>Total Amount</span>
				<span>$35.66</span>
			
			</div>
			<div className={classes.actions}>
				<button onClick = {closeHandler} className={classes['button--alt']}>close</button>
				<button className={classes.button}>order</button>
			</div>
	</Modal>
	</Card>
	)
}
export default Cart;
